import React from 'react';
import './Profile.css';

const Profile = (props) => {
    return (
        <div>
            <div><img src="https://whatsism.com/uploads/posts/2018-05/thumbs/1525374264_7f85e7b.jpeg"></img></div>
            <h1>Мой профиль</h1>
        </div>
    )
}

export default Profile;
